import React , {Component} from 'react'
import ReactDOM from 'react-dom';
import { Container, Row, Col , Button } from 'reactstrap';


class CalculatorButton extends Component{

  render(){

    const {calculate} = this.props

    return(
      <Row className="justify-content-md-center">
          <Col md="9" ><button value="7" onClick={ e => calculate(e.target.value)}>7</button></Col>
          <div className="col-md-3" ><button value="8" onClick={ e => calculate(e.target.value)}>8</button></div>
          <div className="col-md-3" ><button value="9" onClick={ e => calculate(e.target.value)}>9</button></div>
          <div className="col-md-3" ><button value="+" onClick={ e => calculate(e.target.value)}>+</button></div>

          <div className="col-md-3" ><button value="4" onClick={ e => calculate(e.target.value)}>4</button></div>
          <div className="col-md-3" ><button value="5" onClick={ e => calculate(e.target.value)}>5</button></div>
          <div className="col-md-3" ><button value="6" onClick={ e => calculate(e.target.value)}>6</button></div>
          <div className="col-md-3" ><button value="-" onClick={ e => calculate(e.target.value)}>-</button></div>

          <div className="col-md-3" ><button value="1" onClick={ e => calculate(e.target.value)}>1</button></div>
          <div className="col-md-3" ><button value="2" onClick={ e => calculate(e.target.value)}>2</button></div>
          <div className="col-md-3" ><button value="3" onClick={ e => calculate(e.target.value)}>3</button></div>
          <div className="col-md-3" ><button value="*" onClick={ e => calculate(e.target.value)}>*</button></div>

          <div className="col-md-3" ><button value="0" onClick={ e => calculate(e.target.value)}>0</button></div>
          <div className="col-md-3" ><button value="CLR" onClick={ e => calculate(e.target.value)}>CLR</button></div>
          <div className="col-md-3" ><button value="=" onClick={ e => calculate(e.target.value)}>=</button></div>
          <div className="col-md-3" ><button value="/" onClick={ e => calculate(e.target.value)}>/</button></div>

      </Row>

    )

  }


}



export default CalculatorButton ;
